                        <html><head><meta charset="utf-8"></head><body>
<p>Эксель Мультивитамины для взрослых собак &ndash; комплексная витаминно-минеральная добавка, специально разработанная для удовлетворения потребностей взрослых собак. Сбалансированная формула необходимых витаминов и микроэлементов помогает предотвратить проблемы, связанные с неполноценностью рациона и помогает вам сохранять собаку активной и здоровой.<br />&bull; Комплексная мультивитаминная добавка<br />&bull; Специальная формула для взрослых собак всех пород<br />&bull; Содержит стабилизированную форму витамина С, антиоксиданты и микроэлементы для здорового и активного образа жизни вашего питомца<br />&bull; Восполняет дефицит питательных веществ врационе<br />&bull; Разработан при участии ветеринарных врачей</p>
</body></html>

