                        <html><head><meta charset="utf-8"></head><body>
<p>Состав: пивные дрожжи (Saccharomyces cerevisiae), мука из зародышей пшеницы, дикальцийфосфат дигидрат, лактоза, стеариновая кислота, масло из зародышей кукурузы, сахарная пудра, глицерин, натрия хлорид, диоксид кремния, сухое обезжиренное молоко, сухая молочная сыворотка. Не содержит искусственных консервантов и красителей. Аналитический состав (средние значения): Сырой белок 26%, сырой жир 7%, сырая клетчатка 0,5%, зола 15%, влага 8%. Витамины: Витамин А 240000 МЕ/кг, витамин D3 40000 МЕ/кг, витамин Е 700 мг/кг, витамин В1 300 мг/кг, витамин В2 320 мг/кг, витамин В6 32 мг/кг, витамин В12 74 мкг/кг, никотинамид 3830 мг/кг, витамин С 1300 мг/кг. Микроэлементы: Железо 365 мг/кг, медь 14 мг/кг, марганец 25 мг/кг, цинк 565 мг/кг, кобальт 6 мг/кг, йод 21 мг/кг.</p>
